import React from 'react';
import { useNavigate } from 'react-router-dom';

const About = () => {
  const navigate = useNavigate(); // ab useNavigate() ke jitne bhi method or properties thi bho navigate variable me aa chuka hai.

  const goToContact = () => {
    navigate('/contact');
  };
  return (
    <>
      <h1>MY About Pge</h1>
      <button onClick={goToContact}>Go to Contact Page</button>
    </>
  );
};

export default About;

